import '../styles/menubar.css'
import { useNavigate } from "react-router-dom";
import { IoHomeOutline } from "react-icons/io5";
import { RxHamburgerMenu } from "react-icons/rx";
import { IoPersonOutline } from "react-icons/io5";

const MenuBar = () => {
  const navigate = useNavigate();
  const handleClick = (path) => {
    navigate(path);
  }

  return(
    <div className="menubar-container">
      <div className="menubar">
        <button className="repository-icon" onClick={() => handleClick('/storagelist')}>
          <RxHamburgerMenu style={{width:"40px",
            height:"40px",
            backgroundColor:"white",
            cursor:"pointer", borderRadius:"5px"}}/>
        </button>
        <button className="home-icon" onClick={() => handleClick('/')}>
          <IoHomeOutline style={{width:"40px",
            height:"40px",
            backgroundColor:"white",
            cursor:"pointer", borderRadius:"5px"}}/>
        </button>
        <button className="login-icon" onClick={() => handleClick('/logout')}>
          <IoPersonOutline style={{width:"40px",
            height:"40px",
            backgroundColor:"white",
            cursor:"pointer", borderRadius:"5px"}}/>
        </button>
      </div>
    </div>
  );
}

export default MenuBar;
